import React from 'react';
import '../styles/Nav.css';

function Nav() {
  return (
    <div className='nav'>
      <h1 className='nav-header'>SportsBook</h1>
      <div className='nav-links'>
        <li className='nav-link'>Logout</li>
      </div>
    </div>
  );
};

export default Nav;
